import { Link } from "react-router-dom";
import Back from "../components/common/back/Back";

const AdminNavBar = () => {
  return (
    <div className="bg-gray-800 p-4 h-[50vh] rounded-lg shadow-md flex flex-col justify-center items-center">
      <Back title="Admin" />
      <ul className="flex flex-col justify-start items-center space-y-4">
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/course" className="text-white hover:text-gray-300">
            Courses
          </Link>
        </li>
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/admin/roadmap" className="text-white hover:text-gray-300">
            Roadmap
          </Link>
        </li>
        <li className="hover:scale-105 transition-transform duration-300">
          <Link to="/test-notes" className="text-white hover:text-gray-300">
            Test Notes
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default AdminNavBar;
